Thealoz Duo er øjendråber til tørre øjne. De er 100 % fri for konserveringsmidler og særdeles effektive. Thealoz Duo er sammensat af trehalose samt hyaluronsyre, hvilket også er årsagen til deres hurtige og optimale virkning.

&nbsp;

<b><u>Hvorfor vælge Thealoz Duo øjendråber?</u></b>
<ul class="list-1">
 	<li>Forebygger udtørring og irritation af øjnene</li>
 	<li>Beskytter øjnene</li>
 	<li>Længere virkning</li>
</ul>
&nbsp;

&nbsp;

<strong>OBS</strong>: Ingen returret på dette produkt, da det hører under medicinsk udstyr.

&nbsp;

&nbsp;
<h3>Anvendelse af Thealoz Duo øjendråber</h3>
Den anbefalede dosering af Thealoz Duo øjendråber er 1 dråbe i hvert øje - 4 til 6 gange dagligt. Du kan bruge Thealoz Duo sammen med kontaktlinser.

